import React from "react";
import css from "./Users.module.css";

const Users = (props) => {
  let userForm = props.users.map((u) => (
    <div className={css.form} key={u.id}>
      <div className={css.person}></div>
      <div className={css.data}>
        <div className={css.fullName}>{u.fullName}</div>
        <div className={css.location}>
          {u.location.country} - {u.location.city}
        </div>
        <div className={css.status}> ' {u.status} ' </div>
      </div>
    </div>
  ));
  return <div className={css.users}>{userForm}</div>;
};

export default Users;
